void handleChoice(s32 choice, s32 openSlot) {
    Player* playerMain = GetPlayerStruct(-1);
	SpaceData* spaceData = GetSpaceData(WarpDestination);
	s32 previousSpaceChainAndSpaceIndex;
	s32 nextSpaceChainAndSpaceIndex;
	s8 previousChainIndex;
	s8 previousSpaceIndex;
	s8 nextChainIndex;
	s8 nextSpaceIndex;

	beginning:
	switch (choice) {
        case 0: //Take me!
			showMessageWrapper(GameGuyPortrait, takeMeChoice);
			closeMessageWrapper();
			InitFadeOut(4, 20);
			SleepProcess(60);
			SetPlayerOntoAbsSpaceIndex(WarpDestination, &playerMain->cur_chain_index, &playerMain->cur_space_index);
			playerMain->obj->xPos = spaceData->xPos;
            playerMain->obj->yPos = spaceData->yPos;
			playerMain->obj->zPos = spaceData->zPos;
			//set previous chain and space
			previousSpaceChainAndSpaceIndex = abs_space_index_to_chain_and_space_index(PreviousSpace);
			previousChainIndex = previousSpaceChainAndSpaceIndex >> 8;
			previousSpaceIndex = (s8)previousSpaceChainAndSpaceIndex;
			playerMain->reverse_chain_index = previousChainIndex;
			playerMain->reverse_space_index = previousSpaceIndex;
			//
			//set next chain and space
			nextSpaceChainAndSpaceIndex = abs_space_index_to_chain_and_space_index(NextSpace);
			nextChainIndex = nextSpaceChainAndSpaceIndex >> 8;
			nextSpaceIndex = (s8)nextSpaceChainAndSpaceIndex;
			playerMain->next_chain_index = nextChainIndex;
			playerMain->next_space_index = nextSpaceIndex;
			InitFadeIn(4, 20);
			SleepProcess(30);
            PlaySound(0X2A3);
            SleepProcess(6);
            PlaySound(0X2A3);
            showMessageWrapper(GameGuyPortrait, happyGamblingMessage);
			closeMessageWrapper();
			break;
        case 1: //Take it!
			showMessageWrapper(GameGuyPortrait, soldLuckyCoin);
			closeMessageWrapper();
			AdjustPlayerCoinsGradual(GetCurrentPlayerIndex(), 1 * 30);
			ShowPlayerCoinChange(GetCurrentPlayerIndex(), 30);
			playerMain->items[openSlot] = 0xFF;
			FixUpPlayerItemSlots(GetCurrentPlayerIndex());
			//2nd call may not be needed?
			FixUpPlayerItemSlots(GetCurrentPlayerIndex());
			RefreshHUD(GetCurrentPlayerIndex());
			SleepProcess(30);
			showMessageWrapper(GameGuyPortrait, soldLuckyCoinPartingMessage);
			closeMessageWrapper();
			break;
        case 2: //No way!
			showMessageWrapper(GameGuyPortrait, noWayChoice);
			closeMessageWrapper();
			break;
    }
}

