asm(
"abs_space_index_to_chain_and_space_index:\n"
//takes arg a0, abs_space_index
//returns chain_index to v0
//returns space_index to v1
"ADDIU sp, sp, -0x40\n"
"SW ra, 0x0018 (sp)\n"
"SW s0, 0x001C (sp)\n"
"SW s1, 0x0020 (sp)\n"
"SW s2, 0x0024 (sp)\n"
"SW s3, 0x0028 (sp)\n"
"SW s4, 0x002C (sp)\n"
"SW s5, 0x0030 (sp)\n"
"SW s6, 0x0034 (sp)\n"
"ORI s3, r0, 0x0000\n" //init s3 to 0
"ADDIU s4, r0, 0xFFFF\n" //init s4 to FFFF, loop1 counter
"LUI s0, 0x8010\n"
"LW s0, 0x5218 (s0)\n" //load ptr to beginning of hydrated chains ptr
"DADDU s1, a0, r0\n" //move abs_space_index to s0
"Loop0:\n"
"ADDIU s4, s4, 0x0001\n" //add 1 to current loop total
"LHU s2, 0x0000 (s0)\n" //load total number of space_indicies in chain
"BEQ s2, r0, error\n"
"NOP\n"
"ORI t0, r0, 0x0000\n" //going to be used for loop 2 counter
"LW s3, 0x0004 (s0)\n" //load pointer that points to abs space_indicies for current chain in loop
"Loop2:\n"
//
"LHU t1, 0x0000 (s3)\n" //load abs value from hydrated chain
"BEQ t1, s1, isabs\n"
"NOP\n"
"ADDIU t0, t0, 0x0001\n" //add 1 to loop2 counter
"BEQ t0, s2, backtoLoop1\n"
"NOP\n"
"BEQ r0, r0, Loop2\n"
"ADDIU s3, s3, 0x0002\n"
"returnvalues:\n"
//
"exit0:\n"
"SLL v0, v0, 08\n"
"OR v0, v0, v1\n"
"LW ra, 0x0018 (sp)\n"
"LW s0, 0x001C (sp)\n"
"LW s1, 0x0020 (sp)\n"
"LW s2, 0x0024 (sp)\n"
"LW s3, 0x0028 (sp)\n"
"LW s4, 0x002C (sp)\n"
"LW s5, 0x0030 (sp)\n"
"LW s6, 0x0034 (sp)\n"
"JR RA\n"
"ADDIU sp, sp, 0x40\n"
"error:\n"
"ORI v0, r0, 0xFFFF\n" //error, return FFFF
"BEQ r0, r0, exit0\n"
"ORI v1, r0, 0xFFFF\n" //error, return FFFF
"isabs:\n"
//s4 holds current chain index
//t1 holds current space index in chain
"ADD v0, s4, r0\n" //move chain index to v0
"BEQ r0, r0, exit0\n"
"ADD v1, t0, r0\n" //move space_index to v1
"backtoLoop1:\n"
"BEQ r0, r0, Loop0\n"
"ADDIU s0, s0, 0x0008\n" //advance to next hydrated chains ptr
);

